import PropTypes from "prop-types";

const Picture = (props) => {
  return (
    <div className="picture">
      <p>photographer</p>
      <div className="imageContainer">
        <img src="" alt="" />
      </div>
      <p>
        Download Image Here: <a href=""></a>
      </p>
    </div>
  );
};

Picture.propTypes = {};

export default Picture;
